  return (
    <div>
    <Link activeClass="active" className="test1" to="test1" spy={true} smooth={true} duration={500} ><MenuItem>About Us</MenuItem></Link>

    <MenuItem>Product</MenuItem>
    <MenuItem>Newsroom</MenuItem>
    <MenuItem>Careers</MenuItem>
